To allow the library to be successfully compiled for a new platform, the following changes will need to be made to the library. Update the library's CMake file to support the platform The library's CMake file (located at projects/project_libs/libubootdrivers/CMakeLists.txt or microkit/libubootdrivers/CMakeLists.txt) contains a section titled Platform specific settings to control the settings for each platform. This section: Declares a set of variables to control which drivers and optional capabilities are to be built for each platform. The default values produce a build including only a dummy timer driver; this is the minimum necessary to allow the library to be built. Provides a conditional block of settings associated with each supported platform, e.g. to control which of the supported drivers to build. If no conditional block is supplied for a platform, the compilation of the library fails and an error message is returned. The minimal change to this section that allows the library to be built is therefore the inclusion of a conditional block for the platform, even if that section makes no changes to the default settings. For example, to add support for a platform that is named foo within the seL4 build system, the following changes would be required: # Set up the applicable drivers and platform dependent configuration. if(KernelPlatImx8mq) ...
+ elseif("${KernelPlatform}" STREQUAL "foo")
+ # Platform specific settings for the Foo board. else() message(FATAL_ERROR "Unsupported platform. Aborting.") endif() Note that where settings are shared across multiple platforms, this logic can be simplified to reflect the shared settings. An example of this is provided in the library's CMakeLists.txt for the maaxboard and imx8mq-evk platforms, which both use the iMX8MQ SoC. It should also be noted that U-Boot drivers can support multiple devices. For example, many of the drivers added to support the Avnet MaaXBoard support multiple iMX SoCs. If previously supported drivers are compatible with the new platform, this support can be added now; for example, if platform foo has a GPIO device supported by the gpio_mxc driver (as used by the Avnet MaaXBoard), then the line set(gpio_driver "gpio_mxc") could be added to the foo platform's settings to enable support. To enable access to platform specific header files it is necessary to create a symlink within the U-Boot code structure named arch to one of the many arch-xxx folders provided by U-Boot; this mimics an equivalent action taken by U-Boot's native build system. As an example it can be seen that for the iMX8MQ based platforms the arch symlink points to the arch-imx8m folder. It is expected that identification of the correct folder to link to will in most cases will be possible through naming convention alone. To definitively determine the folder to link, the symlink created during a build of U-Boot could be inspected. Define platform specific Linker Lists data structure As documented within the Linker Lists section of the library overview , the library requires a global data structure named driver_data to be declared to allow the U-Boot source code to access optional functionality included in the executable. To define driver_data for the new platform, new platform-specific files must be added to the library. The code blocks that follow provide minimal templates for these files that include the base device classes, drivers for those classes, and base commands that are required by all platforms. File include/plat/foo/plat_driver_data.h: /* * This file defines which drivers, driver classes, driver entries and commands * are to be included in the compiled library for this platform. * * This allows only the drivers compatible with the targeted platform to be * included with all non-compatible drivers excluded. * * It should be noted that some of these are fundamental to allowing the U-Boot * driver model to function (e.g. the nop, root and simple bus drivers). */ /* Define the number of different driver elements to be used on this platform */
#define _u_boot_uclass_driver_count 5
#define _u_boot_driver_count 2
#define _u_boot_usb_driver_entry_count 0
#define _u_boot_part_driver_count 0
#define _u_boot_cmd_count 3
#define _u_boot_env_driver_count 0
#define _u_boot_env_clbk_count 0
#define _u_boot_driver_info_count 0
#define _u_boot_udevice_count 0 /* Define the uclass drivers to be used on this platform. The count of declarations * in this section must match the value of _u_boot_uclass_driver_count */
extern struct uclass_driver _u_boot_uclass_driver__nop;
extern struct uclass_driver _u_boot_uclass_driver__root;
extern struct uclass_driver _u_boot_uclass_driver__simple_bus;
extern struct uclass_driver _u_boot_uclass_driver__phy;
extern struct uclass_driver _u_boot_uclass_driver__blk; /* Define the drivers to be used on this platform. The count of declarations * in this section must match the value of _u_boot_driver_count */
extern struct driver _u_boot_driver__root_driver;
extern struct driver _u_boot_driver__simple_bus; /* Define the driver entries to be used on this platform. The count of declarations * in this section must match the value of _u_boot_usb_driver_entry_count */ /* Define the disk partition types to be used. The count of declarations * in this section must match the value of _u_boot_part_driver_count */ /* Define the u-boot commands to be used on this platform. The count of declarations * in this section must match the value of _u_boot_cmd_count */
extern struct cmd_tbl _u_boot_cmd__dm;
extern struct cmd_tbl _u_boot_cmd__env;
extern struct cmd_tbl _u_boot_cmd__setenv; /* Define the u-boot environment variables callbacks to be used on this platform. The * count of declarations in this section must match the value of _u_boot_env_clbk_count */ File src/plat/foo/plat_driver_data.c: #include <uboot_helper.h>
