To associate the driver with the platform, the following changes need to be made. CMakeLists.txt Within the platform specific section of the library CMakeLists.txt file, the variable holding the selected driver for the driver class must be set. For example, if a GPIO driver named gpio_foo has been added for platform foo then the following would be added: # Set up the applicable drivers and platform dependent configuration. if(KernelPlatImx8mq) ... elseif("${KernelPlatform}" STREQUAL "foo") # Platform specific settings for the Foo board.
+ set(gpio_driver "gpio_foo") else() message(FATAL_ERROR "Unsupported platform. Aborting.") endif() plat_driver_data.h The plat_driver_data.h and plat_driver_data.c files are used to create arrays of objects, such as drivers or commands, that U-Boot normally stores in dedicated linker sections (see documentation on linker lists for details). The objects are declared in U-Boot source files via macros of the form U_BOOT_<object_type> = { ... };. All objects that the library needs to access must be declared and enumerated in plat_driver_data.h and added to the driver_data structure within plat_driver_data.c. Within the platform's include/plat/<platform>/plat_driver_data.h file, the new objects from the added source files (e.g. driver, UCLASS driver, commands, etc.) need to be declared, and the counts of each class of object needs to be updated. It should be noted that sometimes multiple drivers or UCLASS drivers are required to support a single device. For example, if a GPIO driver were to be added then it is expected that the GPIO driver, the GPIO UCLASS driver, and the GPIO command objects would be added as follows: extern struct uclass_driver _u_boot_uclass_driver__gpio;
extern struct driver _u_boot_driver__gpio_foo;
extern struct cmd_tbl _u_boot_cmd__gpio; Each declaration is of the form extern struct <type> _u_boot_<class>__<name> to match the declaration generated by the expansion of the U_BOOT_<object_Type> macro, where: <name> is the parameter provided to the macro that declared the object, e.g. a driver is declared with U_BOOT_DRIVER(<name>); <type> and <class> directly correspond to the type of object. Worked examples of the correct format for each object type are provided in the Avnet MaaXBoard's plat_driver_data.h file. Alternatively, the format for each type of object can be determined from the expansion of the macro for that object type; e.g. for a driver, see the expansion of #define U_BOOT_DRIVER. plat_driver_data.c Within the platform's include/plat/<platform>/plat_driver_data.c file, the objects declared in the plat_driver_data.h file need to be added to the driver_data global structure. A worked example covering multiple object types is provided in the Avnet MaaXBoard's plat_driver_data.c file.
